import React, { Component } from "react";

class NrCollection extends Component {
  render() {
    console.log(this.props.nrcolname);
    return (
        <li className="categoryTemaItem">
        <a className="categoryTemaLinkMain" href>
        {this.props.nrcolname}
        </a>
      </li>
    )
  }
}

export default NrCollection;
